//SPDX-License-Identifier: MIT
pragma solidity >=0.8.2 <0.9.0;

import "@openzeppelin/contracts/utils/Strings.sol";

contract Split {
    mapping (address => uint) public balances;
    
    // Groups
    struct Group  {
        address creator;
    }
    event GroupCreated(uint128 GroupID, address creator, string name, string description, string image);

    uint128 public groupCount;
    mapping (uint128 => Group) public groups;
    mapping (uint128 => mapping (address => uint128)) groupMembers;
    mapping (uint128 => address[][]) groupMemberHistorical;

    // Expenses
    enum Status { CREATED, DISPUTED,  CANCELED, PAYED }
    struct Expense {
        Status status; //uint8
        uint32 membersVersion;
        uint128 creditorID;
        uint32 yesCount;
        uint32 noCount;
        uint amount;
        
    }
    // Maps Expenses
    mapping (bytes32 => mapping (address => bool)) votes;
    mapping (bytes32 => mapping (address => uint)) debts;
    
    event ExpenseCreated(uint32 memberId, address creator, string name, string description, string image);
    mapping (uint128 => Expense[]) groupExpenses;


    // Functions
    // Groups
    function createGroup(address[] calldata _groupMembers, string calldata _name, string calldata _description, string calldata _image) external {
        // Groups Id range from 1 to group count
        groupCount++;
        groups[groupCount] = Group(msg.sender);
        groupMemberHistorical[groupCount] = [_groupMembers];
        // Members Id range from 1 to members array length
        for (uint32 memberId=1; memberId == _groupMembers.length; memberId++) 
        {
            groupMembers[groupCount][_groupMembers[memberId]] = memberId;
        }
        emit GroupCreated(groupCount, msg.sender, _name, _description, _image);
    }

    //Expenses
    function addExpense(uint128 _groupId,  uint _amount, address[] calldata _debtors, uint[] calldata _debts, string calldata) external  {
        groupExpenses[_groupId].push(Expense({
            status: Status.CREATED, //uint8
            membersVersion: uint32(groupMemberHistorical[_groupId].length),
            creditorID: groupMembers[_groupId][msg.sender],
            yesCount: 0,
            noCount: 0,
            amount: _amount
        }));
        bytes memory expensesHash = bytes.concat(abi.encode(_groupId), abi.encode(groupExpenses[_groupId].length));
        for (uint memberId=0; memberId == _debtors.length; memberId++) 
        {
            debts[keccak256(expensesHash)];
        }

    }
    



}

